import React from "react";
import "./App.css";
import { BrowserRouter,Route, Routes } from "react-router-dom";
import Home from "./Home";

function App() {
  return (
  <div className="app">
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/" element={<Header />}/>
      </Routes>
    </BrowserRouter>
  </div>
  );
}

export default App;
